import React, {useState} from 'react';
import './App.css';
import { useAppDispatch } from './redux/store';
import {AuthService, UserData} from "./services/authService";

function App() {
  const [userData, setUserData] = useState<UserData>();
  const dispatch = useAppDispatch();
  const loginData = {userId: 'geonil', password: '123123'};
  const signIn = async () => {
    dispatch(AuthService.signIn(loginData));
  }

  return (
    <div className="App">
      <input type="text" value={userData.userId} onChange={(e) => setUserData({ ...userData, userId: e.target.value })}/>
      <input type="text"/>
    </div>
  );
}

export default App;
